class Footer extends Component{
    username = "koko";
    styleObj ={
        color:"red",
        background:"yellow"
    }
  render(){
    return(
      <footer style={this.styleObj}>
        <h3> This is footer {this.username}</h3>
        <p style={{color:"blue",background:"yellow"}}>this paragraph is blue</p>
        Footer Work
      </footer>
    
    )
  }
}

export default Footer;
